$(function(){window.innerWidth>1200&&$(window).on("mousemove",function(n){var a=$(window).width(),o=$(window).height(),t=.5-n.pageX/a,i=.5-n.pageY/o;$(".parallax").each(function(n,a){var o=parseInt($(a).data("offset")),d="translate3d("+Math.round(t*o)+"px,"+Math.round(i*o)+"px, 0px";$(a).css({transform:d})})})});